// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract Auction {
    address owner;
    address public highestBidder; // The highest bidder's address
    uint public highestBid; // The amount of the highest bid
    mapping(address => uint) public userBalances; // mapping for the amount to return

    constructor() payable {// contractor
        // 1. Initialize highest bid and the bidder's address
        owner = msg.sender;
        highestBidder = owner;
        highestBid = 0;
    }

    modifier notOwner() {
        require(msg.sender != owner, "You are the owner of this contract, you can't bid!");
        _;
    }

    function getContractBalance() public view returns(uint) {
        return address(this).balance;
    }

    function bid() public payable notOwner { // Function to process bid
        // 1. Check if the bid is greater than the current highest bid
        // 2. Update status variable and the amount to return

        require(msg.value > highestBid, "The bid is less than the current highest bid!");

        userBalances[msg.sender] = msg.value;

        highestBidder = msg.sender;
        highestBid = msg.value;
    }

    modifier canWithdraw() {
        require(userBalances[msg.sender] > 0, "Amount to return is 0!");
        _;
    }

    function withdraw() public payable canWithdraw { // Function to withdraw the amount of bid to return
        // 1. Check if the amount to return is greater than zero
        // 2. Update status variableand return bid

        require(userBalances[msg.sender] != highestBid, "The highest bidder can not withdraw.");
        payable(msg.sender).transfer(userBalances[msg.sender]);
        userBalances[msg.sender] = 0;
    }

    receive() external payable {  }
}
